import { Layout } from './Layout';
import {Card} from './Card'
import './App.css';
import {Joke} from './Joke'
import jokesData from "./JokeData"
import stuffData from "./StuffData"


function App() {
const jokeElements=jokesData.map(joke=>{return<Joke setup={joke.theme} body={joke.joke} />})

const offer=stuffData.map(element=>{return <Card img={element.img} rate={element.rating} />})
  return (
    <div className="App">
      <Layout />

      {jokeElements}
      {offer}

    </div>
  );
}

export default App;
